import React from 'react'
import { Text, View } from 'react-native'
import tw from "twrnc";
import ActiveOrderIndicator from '../ActiveOrderIndicator/ActiveOrderIndicator';

/*
Functional component that will map JSON data to UI Component.
*/

export default function ListItem(props) {
    return (    
    <View
    style={tw`bg-gray-600 rounded-sm w-96 p-4 my-1 grid grid-rows-2 gap-4 grid-cols-2`}
    >
      <View
      style={tw`bg-green-600 p-5 col-span-1 `}      
      >
        <Text>Order info</Text>
      </View>

      <View
      style={tw`bg-red-600 p-5 col-span-1`}
      >
        <Text>Next</Text>
      </View>
    </View>
  )
}
